<!DOCTYPE html>
<html lang="{{ site.lang | default: " en-US" }}">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta name="theme-color" content="#157878">
    <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
    <link rel="stylesheet" href="{{ '/assets/css/style.css?v=' | append: site.github.build_revision | relative_url }}">
</head>

<body>
    <header class="page-header" role="banner">
        <h1 class="project-name">Malaysia of Roblox Growth</h1>
    </header>

    <main id="content" class="main-content" role="main">

        <iframe style="display:block;" width="800" height="670" seamless frameborder="0" scrolling="no"
            src="https://docs.google.com/spreadsheets/d/e/2PACX-1vST-Uol725_7QEf1MlOuZFQlT-EkWCeNsSL_pi6vD5dx4IyFjYkLmumOr97esrxyvc-whN1iF8-K2tX/pubchart?oid=2135731931&amp;format=interactive"></iframe>

        <footer class="site-footer">
            {% if site.github.is_project_page %}
            <span class="site-footer-owner"><a href="{{ site.github.repository_url }}">{{ site.github.repository_name
                    }}</a> is maintained by <a href="{{ site.github.owner_url }}">{{ site.github.owner_name
                    }}</a>.</span>
            {% endif %}
        </footer>
    </main>
</body>

</html>
